import React from 'react';
import customButton from './customButton.css';

const CustomButton = ({ label, colour, onClick, icon }) => {
    const buttonClass = (() => {
        switch (colour) {
            case 'yellow':
                return 'custom-button yellow';
            case 'blue':
                return 'custom-button blue';
            case 'grey':
            default:
                return 'custom-button grey';
        }
    })();

    return (
        <button className={buttonClass} onClick={onClick}>
            {icon && <i className={`pi pi-${icon}`} style={{ marginRight: '8px' }}></i>}
            {label}
        </button>
    );
};

export default CustomButton;
